(791, 'Products/FREDDE Gaming desk, black, 140-185x74x146 cm.jpg', 'FREDDE Gaming desk, black, 140-185x74x146 cm', 199.00, 'How do you make the perfect gaming station? That\'s what we set out to do with FREDDE desk by researching competitive gaming and enlisting a gamer designer of our own.', 'Desks', '[\"Products/FREDDE Gaming desk, black, 140-185x74x146 cm_0.jpg\",\"Products/FREDDE Gaming desk, black, 140-185x74x146 cm_1.jpg\",\"Products/FREDDE Gaming desk, black, 140-185x74x146 cm_2.jpg\"]'),
(792, 'Products/UTESPELARE Gaming desk, black, 160x80 cm.jpg', 'UTESPELARE Gaming desk, black, 160x80 cm', 129.00, 'Raise the large, sturdy UTESPELARE gaming desk to a height that optimally suits you. The metal mesh at the back of the table top allows air to circulate and cool your PC when the match heats up.', 'Desks', '[\"Products/UTESPELARE Gaming desk, black, 160x80 cm_0.jpg\",\"Products/UTESPELARE Gaming desk, black, 160x80 cm_1.jpg\",\"Products/UTESPELARE Gaming desk, black, 160x80 cm_2.jpg\"]'),
(793, 'Products/UTVISNING Gaming desk with shelf, black, 120x60 cm.jpg', 'UTVISNING Gaming desk with shelf, black, 120x60 cm', 90.00, 'This gaming desk is perfect for creating a compact space for playing. Height adjustment, cable management, a shelf for monitors and a computer tower solution – all designed so you can focus on the match.', 'Desks', '[\"Products/UTVISNING Gaming desk with shelf, black, 120x60 cm_0.jpg\",\"Products/UTVISNING Gaming desk with shelf, black, 120x60 cm_1.jpg\",\"Products/UTVISNING Gaming desk with shelf, black, 120x60 cm_2.jpg\"]'),
(794, 'Products/UTMANING Gaming desk, black, 160x80 cm.jpg', 'UTMANING Gaming desk, black, 160x80 cm', 165.00, 'Functional design, smart details and the possibility to set the height during assembly. This desk helps you find your most comfortable gaming position. Quality tested for many years of use.', 'Desks', '[\"Products/UTMANING Gaming desk, black, 160x80 cm_0.jpg\",\"Products/UTMANING Gaming desk, black, 160x80 cm_1.jpg\",\"Products/UTMANING Gaming desk, black, 160x80 cm_2.jpg\"]'),
(795, 'Products/UTMANING Gaming desk sit-stand, electric-black, 160x80 cm.jpg', 'UTMANING Gaming desk sit-stand, electric-black, 160x80 cm', 405.00, 'The electric UTMANING gaming desk helps you play better and longer since you can choose your most ergonomic position. Quality tested for years of ups and downs, not just in the game.', 'Desks', '[\"Products/UTMANING Gaming desk sit-stand, electric-black, 160x80 cm_0.jpg\",\"Products/UTMANING Gaming desk sit-stand, electric-black, 160x80 cm_1.jpg\",\"Products/UTMANING Gaming desk sit-stand, electric-black, 160x80 cm_2.jpg\"]'),
(796, 'Products/HUVUDSPELARE Gaming desk, black, 140x80 cm.jpg', 'HUVUDSPELARE Gaming desk, black, 140x80 cm', 115.00, 'This gaming table has all those key features that help you play at the top of your game: stability, cable management and a hook for your headphones. A good choice for those who want to focus on the match.', 'Desks', '[\"Products/HUVUDSPELARE Gaming desk, black, 140x80 cm_0.jpg\",\"Products/HUVUDSPELARE Gaming desk, black, 140x80 cm_1.jpg\",\"Products/HUVUDSPELARE Gaming desk, black, 140x80 cm_2.jpg\"]'),
(797, 'Products/BRÄNNBOLL Gaming station, light grey-white, 100x72x180 cm.jpg', 'BRÄNNBOLL Gaming station, light grey-white, 100x72x180 cm', 250.00, 'Always ready. This flexible gaming station holds all your gear, so you can quickly get started. And when you\'re done playing, you can hide everything behind the doors – even your gaming chair.', 'Desks', '[\"Products/BRu00c4NNBOLL Gaming station, light grey-white, 100x72x180 cm_0.jpg\",\"Products/BRu00c4NNBOLL Gaming station, light grey-white, 100x72x180 cm_1.jpg\",\"Products/BRu00c4NNBOLL Gaming station, light grey-white, 100x72x180 cm_2.jpg\"]'),
(798, 'Products/UPPSPEL Underframe sit-stand f table tp, el, black, 180-140x80 cm.jpg', 'UPPSPEL Underframe sit-stand f table tp, el, black, 180-140x80 cm', 360.00, 'The height of the electric underframe can be adjusted from 72 to 120 cm, so you can always sit or stand at a comfortable height.', 'Desks', '[\"Products/UPPSPEL Underframe sit-stand f table tp, el, black, 180-140x80 cm_0.jpg\",\"Products/UPPSPEL Underframe sit-stand f table tp, el, black, 180-140x80 cm_1.jpg\",\"Products/UPPSPEL Underframe sit-stand f table tp, el, black, 180-140x80 cm_2.jpg\"]'),
(799, 'Products/UPPSPEL Gaming desk, black, 180x80 cm.jpg', 'UPPSPEL Gaming desk, black, 180x80 cm', 449.00, 'UPPSPEL gaming desk helps you perform at your best. It’s large, durable and sturdy. You can also quickly and easily adjust the height so that you always enjoy the optimal position during the match.', 'Desks', '[\"Products/UPPSPEL Gaming desk, black, 180x80 cm_0.jpg\",\"Products/UPPSPEL Gaming desk, black, 180x80 cm_1.jpg\",\"Products/UPPSPEL Gaming desk, black, 180x80 cm_2.jpg\"]'),
(800, 'Products/UPPSPEL Gaming desk, black, 140x80 cm.jpg', 'UPPSPEL Gaming desk, black, 140x80 cm', 435.00, 'UPPSPEL gaming desk helps you perform at your best. It’s large, durable and sturdy. You can also quickly and easily adjust the height so that you always enjoy the optimal position during the match.', 'Desks', '[\"Products/UPPSPEL Gaming desk, black, 140x80 cm_0.jpg\",\"Products/UPPSPEL Gaming desk, black, 140x80 cm_1.jpg\",\"Products/UPPSPEL Gaming desk, black, 140x80 cm_2.jpg\"]'),
(801, 'Products/UPPSPEL Table top, black, 180 cm.jpg', 'UPPSPEL Table top, black, 180 cm', 89.00, 'You can position the table top in two different ways. If you have the contour shape facing forwards, you enjoy relief for forearms and wrists – and having it at the back creates a gap where you can lead all the cables down.', 'Desks', '[\"Products/UPPSPEL Table top, black, 180 cm_0.jpg\",\"Products/UPPSPEL Table top, black, 180 cm_1.jpg\",\"Products/UPPSPEL Table top, black, 180 cm_2.jpg\"]'),
