(803, 'Products/STYRSPEL Gaming chair, dark gray-gray.jpg', 'STYRSPEL Gaming chair, dark gray-gray', 369.99, 'STYRSPEL gaming chair helps you play at the top of your game. Adjust the headrest, lumbar support, armrests and the seat height and depth – the mesh material keeps you cool when the game heats up!', 'Chairs', '[\"Products/STYRSPEL Gaming chair, dark gray-gray_0.jpg\",\"Products/STYRSPEL Gaming chair, dark gray-gray_1.jpg\",\"Products/STYRSPEL Gaming chair, dark gray-gray_2.jpg\"]'),
(804, 'Products/UTESPELARE Gaming chair, Bomstad black.jpg', 'UTESPELARE Gaming chair, Bomstad black', 139.99, 'UTESPELARE gaming chair gives your body a nice support with a synchronized seat and back tilt that precisely follows your movements during the entire match. And after playing, you can sit back to recharge.', 'Chairs', '[\"Products/UTESPELARE Gaming chair, Bomstad black_0.jpg\",\"Products/UTESPELARE Gaming chair, Bomstad black_1.jpg\",\"Products/UTESPELARE Gaming chair, Bomstad black_2.jpg\"]'),
(805, 'Products/GRUPPSPEL Gaming chair, Gunnared beige.jpg', 'GRUPPSPEL Gaming chair, Gunnared beige', 399.99, 'Cool gaming chair that blends in nicely with other decor. Equipped with many smart functions that allow you to adjust the back, seat, recline angle, tilt, armrests and headrest to sit really comfy.', 'Chairs', '[\"Products/GRUPPSPEL Gaming chair, Gunnared beige_0.jpg\",\"Products/GRUPPSPEL Gaming chair, Gunnared beige_1.jpg\",\"Products/GRUPPSPEL Gaming chair, Gunnared beige_2.jpg\"]'),
(806, 'Products/MATCHSPEL Gaming chair, Bomstad light gray.jpg', 'MATCHSPEL Gaming chair, Bomstad light gray', 299.99, 'MATCHSPEL gaming chair helps you play at the top of your game. Your whole body enjoys nice support and you can adjust the height of the chair, neck and armrests to sit really comfy when the game begins.', 'Chairs', '[\"Products/MATCHSPEL Gaming chair, Bomstad light gray_0.jpg\",\"Products/MATCHSPEL Gaming chair, Bomstad light gray_1.jpg\",\"Products/MATCHSPEL Gaming chair, Bomstad light gray_2.jpg\"]'),
(807, 'Products/HUVUDSPELARE Gaming chair, black.jpg', 'HUVUDSPELARE Gaming chair, black', 89.99, 'Adjust the height and angle to sit really comfortably, and let the game begin. The backrest gives you good lumbar support – and even when the game heats up, you stay cool thanks to the mesh net.', 'Chairs', '[\"Products/HUVUDSPELARE Gaming chair, black_0.jpg\",\"Products/HUVUDSPELARE Gaming chair, black_1.jpg\",\"Products/HUVUDSPELARE Gaming chair, black_2.jpg\"]'),
