(809, 'Products/BRÄNNBOLL Gaming lounge chair, Knisa bright blue.jpg', 'BRÄNNBOLL Gaming lounge chair, Knisa bright blue', 249.99, 'Armchair or lounge chair? The choice is yours since the seat cushion is easy to fold out and in. No matter what you prefer, you sit really comfortably while gaming or relaxing.', 'Chairs', '[\"Products/BRu00c4NNBOLL Gaming lounge chair, Knisa bright blue_0.jpg\",\"Products/BRu00c4NNBOLL Gaming lounge chair, Knisa bright blue_1.jpg\",\"Products/BRu00c4NNBOLL Gaming lounge chair, Knisa bright blue_2.jpg\"]'),
