(824, 'Products/ROG NUC 970 RN14SRKU9189AUI Full System Mini PC.jpg', 'ROG NUC 970 RN14SRKU9189AUI Full System Mini PC', 1699.99, 'Key Features\n \n \n  	-    Intel Core Ultra 9 185H (2.3GHz) Processor\n  \n  	-    32GB DDR5-5600 RAM\n  \n  	-    NVIDIA GeForce RTX 4070 Graphics Card\n  \n  	-    1TB PCIe M.2 NVMe Gen4x4 SSD\n  \n  	-    2.5GbE LAN, 2x2 WiFi 6E (802.11ax), Bluetooth 5.3\n  \n  	-    Windows 11 Home', 'PC', '[\"Products/ROG NUC 970 RN14SRKU9189AUI Full System Mini PC_0.jpg\",\"Products/ROG NUC 970 RN14SRKU9189AUI Full System Mini PC_1.jpg\",\"Products/ROG NUC 970 RN14SRKU9189AUI Full System Mini PC_2.jpg\"]'),
(825, 'Products/Gamer Xtreme GXi4600M PC.jpg', 'Gamer Xtreme GXi4600M PC', 1099.99, 'Key Features\n \n \n  	-    Intel Core i5 14400F (1.8GHz) Processor\n  \n  	-    32GB DDR5-6000 RAM\n  \n  	-    Intel Arc B580 Graphics Card\n  \n  	-    1TB PCIe M.2 NVMe Gen4 SSD\n  \n  	-    Gigabit LAN, WiFi 5 (802.11ac), Bluetooth 4.2\n  \n  	-    Windows 11 Home', 'PC', '[\"Products/Gamer Xtreme GXi4600M PC_0.jpg\",\"Products/Gamer Xtreme GXi4600M PC_1.jpg\",\"Products/Gamer Xtreme GXi4600M PC_2.jpg\"]'),
(826, 'Products/Aegis SE 13TA-1233US Gaming PC.jpg', 'Aegis SE 13TA-1233US Gaming PC', 779.99, 'Key Features\n \n \n  	-    Intel Core i5 13400F (1.8GHz) Processor\n  \n  	-    16GB DDR5-6000 RAM\n  \n  	-    NVIDIA GeForce RTX 3050 Graphics Card\n  \n  	-    500GB SSD\n  \n  	-    WiFi 6E (802.11ax), Bluetooth 5.2\n  \n  	-    Windows 11 Home', 'PC', '[\"Products/Aegis SE 13TA-1233US Gaming PC_0.jpg\",\"Products/Aegis SE 13TA-1233US Gaming PC_1.jpg\",\"Products/Aegis SE 13TA-1233US Gaming PC_2.jpg\"]'),
(827, 'Products/MITTLED LED kitchen cntrtp lighting strip, dimmable white, 15 inch.jpg', 'MITTLED LED kitchen cntrtp lighting strip, dimmable white, 15 inch', 20.00, 'The lighting enhances both function and atmosphere in your kitchen and makes working in the kitchen less of a chore. Easy to install – no electrician needed.', 'LED Lighting', '[\"Products/MITTLED LED kitchen cntrtp lighting strip, dimmable white, 15 inch_0.jpg\",\"Products/MITTLED LED kitchen cntrtp lighting strip, dimmable white, 15 inch_1.jpg\",\"Products/MITTLED LED kitchen cntrtp lighting strip, dimmable white, 15 inch_2.jpg\"]'),
(828, 'Products/VATTENSTEN LED light strip, white, 39 inch.jpg', 'VATTENSTEN LED light strip, white, 39 inch', 7.99, 'With this LED lighting strip, you can unleash your creativity and decorate with light in all kinds of places in your home – above cabinets, by the TV or under the sofa. The possibilities are endless!', 'LED Lighting', '[\"Products/VATTENSTEN LED light strip, white, 39 inch_0.jpg\",\"Products/VATTENSTEN LED light strip, white, 39 inch_1.jpg\",\"Products/VATTENSTEN LED light strip, white, 39 inch_2.jpg\"]'),
(829, 'Products/MITTLED LED spotlight, dimmable white.jpg', 'MITTLED LED spotlight, dimmable white', 15.00, 'Show off your beloved dinnerware collection. The lighting enhances the atmosphere and gives a good overview of things inside your cabinets. Easy to install on your own – no electrician needed.', 'LED Lighting', '[\"Products/MITTLED LED spotlight, dimmable white_0.jpg\",\"Products/MITTLED LED spotlight, dimmable white_1.jpg\",\"Products/MITTLED LED spotlight, dimmable white_2.jpg\"]'),
(830, 'Products/ÖVERSIDAN LED wardrobe lighting strp w sensor, dimmable white, 38 inch.jpg', 'ÖVERSIDAN LED wardrobe lighting strp w sensor, dimmable white, 38 inch', 28.00, 'Dark in the wardrobe? Something easily solved with this modern LED light strip with a built-in sensor that is customized for PAX wardrobes.', 'LED Lighting', '[\"Products/u00d6VERSIDAN LED wardrobe lighting strp w sensor, dimmable white, 38 inch_0.jpg\",\"Products/u00d6VERSIDAN LED wardrobe lighting strp w sensor, dimmable white, 38 inch_1.jpg\",\"Products/u00d6VERSIDAN LED wardrobe lighting strp w sensor, dimmable white, 38 inch_2.jpg\"]'),
(831, 'Products/KAPPLAKE LED spotlight, white.jpg', 'KAPPLAKE LED spotlight, white', 3.49, 'It\'s easy to mount KAPPLAKE spotlight with the included sticky gel-pad anywhere you like. The gel pad is easy to roll-off by hand, wash with water and reattach to the lamp.', 'LED Lighting', '[\"Products/KAPPLAKE LED spotlight, white_0.jpg\",\"Products/KAPPLAKE LED spotlight, white_1.jpg\",\"Products/KAPPLAKE LED spotlight, white_2.jpg\"]'),
(832, 'Products/ProMounts Large Universal Tabletop TV Brackets (VESA 800x400) AMSF6401-02.jpg', 'ProMounts Large Universal Tabletop TV Brackets (VESA 800x400) AMSF6401-02', 50.99, 'ProMounts Tabletop TV Stand brackets features:\\n\\n\\t- Fits 37-72 inch flat panels up to 110 lbs with VESA mounting patterns up to \r\\n    800x400mm\\n\\t- Supports all VESA patterns from 200x200 to 800x400 \\n\\t- Sleek, sturdy replacement for the stand included with your TV \r\\n  \\t- Flexible brackets allow for up to 25° swivel \r\\n  \\t- Suited for both Flat and Curved LED, LCD and Plasma displays \r\\n  \\t- Adjustable Brackets fit a wide range of TVs\r\\n  \\t- Low Profile, Minimal Design\r\\n  \\t- Easy to install, all hardware included \r\\n  \\t- Manufacturers Limited Lifetime Warranty \r\\n\\n', 'Stands & Mounts', '[\"Products/ProMounts Large Universal Tabletop TV Brackets (VESA 800x400) AMSF6401-02_0.jpg\",\"Products/ProMounts Large Universal Tabletop TV Brackets (VESA 800x400) AMSF6401-02_1.jpg\",\"Products/ProMounts Large Universal Tabletop TV Brackets (VESA 800x400) AMSF6401-02_2.jpg\"]'),
(833, 'Products/ProMounts Large Tabletop TV Stand (VESA 400x400) PMSA4401.jpg', 'ProMounts Large Tabletop TV Stand (VESA 400x400) PMSA4401', 64.99, 'ProMounts Tabletop TV Stand Mount features:\\n\\n\\t- Fits 37-65 inch flat panels up to 88 lbs with VESA mounting patterns up to 400x400mm\\n\\t- Supports all VESA patterns from 200x200 to 400x400 \\n\\t- Sleek, sturdy replacement for the stand included with your TV \r\\n  \\t- Suited for both Flat and Curved LED, LCD and Plasma displays \r\\n  \\t- 3 Height adjustment options\r\\n  \\t- Integrated cable management system \r\\n  \\t- Strong and stable tempered glass base \r\\n  \\t- Easy to install, all hardware included \r\\n  \\t- Manufacturers Limited Lifetime Warranty \r\\n\\n', 'Stands & Mounts', '[\"Products/ProMounts Large Tabletop TV Stand (VESA 400x400) PMSA4401_0.jpg\",\"Products/ProMounts Large Tabletop TV Stand (VESA 400x400) PMSA4401_1.jpg\",\"Products/ProMounts Large Tabletop TV Stand (VESA 400x400) PMSA4401_2.jpg\"]'),
(834, 'Products/B-Tech Neomounts Full Motion Desk Mount (Single) FPMA-D550BLACK.jpg', 'B-Tech Neomounts Full Motion Desk Mount (Single) FPMA-D550BLACK', 86.00, 'B-Tech\'s Neomounts desk mounts can be easily clamped to the rear or side of \r\\n  a desk or fixed through a grommet hole and the cable management clips ensures \r\\n  a neat and tidy installation. It features:\\n\\n\\t- Fits monitors up to 32 inch with VESA 75x75 or 100x100mm mounting patterns \r\\n    and 18lbs (8kgs)\\n\\t- 3 swivel points, at the pole, arm pivot and interface\\n\\t- Tool-less tilt and full screen rotation\\n\\t- Durable powder coated finish\\n\\t- Manual height adjustment\\n\\t- Supplied with both a desk clamp and grommet\\n\\t- Integrated cable management\\n\\t- Simple installation with all mounting hardware included\\n\\t- Max load: 18lbs (8kgs)\\n\\t- Tilt: +/- 45°\\n\\t- Swivel at pole / arm / interface: 180° / 360° / 180°\\n\\t- Screen rotation: 360°\\n\\t- Depth adjustment: 1.5 inch - 18 inch\\n\\t- Height adjustment: 17.3 inch\\n\\t- Clamp adjustment suitable for desktop thickness: 0.4 inch - 3.5 inch\\n\\n', 'Stands & Mounts', '[\"Products/B-Tech Neomounts Full Motion Desk Mount (Single) FPMA-D550BLACK_0.jpg\",\"Products/B-Tech Neomounts Full Motion Desk Mount (Single) FPMA-D550BLACK_1.jpg\",\"Products/B-Tech Neomounts Full Motion Desk Mount (Single) FPMA-D550BLACK_2.jpg\"]'),
(835, 'Products/ProMounts Large Tabletop Swivel TV Stand (VESA 600x400) AMSA6401-02.jpg', 'ProMounts Large Tabletop Swivel TV Stand (VESA 600x400) AMSA6401-02', 94.99, 'ProMounts Tabletop TV Stand Mount features:\\n\\n\\t- Fits 37-72 inch flat panels up to 99 lbs with VESA mounting patterns up to 600x400mm\\n\\t- Supports all VESA patterns from 200x200 to 600x400 \\n\\t- Sleek, sturdy replacement for the stand included with your TV \r\\n  \\t- Flexible brackets allow for up to 25° swivel \r\\n  \\t- Suited for both Flat and Curved LED, LCD and Plasma displays \r\\n  \\t- Integrated cable management system \r\\n  \\t- Strong and stable tempered glass base \r\\n  \\t- Easy to install, all hardware included \r\\n  \\t- Manufacturers Limited Lifetime Warranty \r\\n\\n', 'Stands & Mounts', '[\"Products/ProMounts Large Tabletop Swivel TV Stand (VESA 600x400) AMSA6401-02_0.jpg\",\"Products/ProMounts Large Tabletop Swivel TV Stand (VESA 600x400) AMSA6401-02_1.jpg\",\"Products/ProMounts Large Tabletop Swivel TV Stand (VESA 600x400) AMSA6401-02_2.jpg\"]'),
(836, 'Products/Audio Visual Furniture Fixed Wedge Monitor Mount (Black) FWM100.jpg', 'Audio Visual Furniture Fixed Wedge Monitor Mount (Black) FWM100', 99.00, 'AVFI\'s Monitor Mount features: \\n\\n\\t- Designed to mount a monitor onto any of AVFIs wedge surfaces\\n\\t- Two piece bracket for easy installation\\n\\t- Mounting hardware included\\n\\t- 50x50, 75x75 and 100x100mm standard mounting plate\\n\\n', 'Stands & Mounts', '[\"Products/Audio Visual Furniture Fixed Wedge Monitor Mount (Black) FWM100_0.jpg\",\"Products/Audio Visual Furniture Fixed Wedge Monitor Mount (Black) FWM100_1.jpg\",\"Products/Audio Visual Furniture Fixed Wedge Monitor Mount (Black) FWM100_2.jpg\"]'),
(837, 'Products/B-Tech Neomounts Desk Monitor Arm (Single) DS60-425BL1.jpg', 'B-Tech Neomounts Desk Monitor Arm (Single) DS60-425BL1', 108.00, 'B-Tech Neomounts desk monitor arm features:\\n\\n\\t- Universal full motion desk mount for monitors up to 27 inch with a maximum \r\\n    weight capacity of 17.6lbs (8 kg).\\n\\t- Versatile tilt (120°), rotate (360°) and swivel (180°) technology \r\\n    allows for the optimal height and viewing angle.\\n\\t- Manual height and depth adjustment to create the perfect working position.\\n\\t- Only minimal depth is required when placed near a wall or separation panel \r\\n    due to the short T-Rex® upper arm.\\n\\t- Smart internal cable management system ensures orderly routing of the cables.\\n\\t- Easy-release VESA system for easy installation.\\n\\t- Includes both desk clamp and grommet.\\n\\t-  VESA pattern: 75x75, 100x100 mm\\n\\t- Min. screen size*: 17 inch\\n\\t- Max. screen size*: 27 inch\\n\\t-  Height adjustment: 10.8-21.9 inch (27.5-55.5 cm)\\n\\t- Width adjustment: 13.07 inch (33.2 cm)\\n\\t- Depth adjustment: 2.6-15.67 inch (6.6-39.8 cm)\\n\\t- Max. weight: 17.6lbs (8 kg)\\n*Please note: The inch sizes stated are just an indication, combined with the \r\\n  weight and VESA sizes. The maximum weight and VESA size are absolute restrictions \r\\n  for the products and should not be exceeded. \\n\\n', 'Stands & Mounts', '[\"Products/B-Tech Neomounts Desk Monitor Arm (Single) DS60-425BL1_0.jpg\",\"Products/B-Tech Neomounts Desk Monitor Arm (Single) DS60-425BL1_1.jpg\",\"Products/B-Tech Neomounts Desk Monitor Arm (Single) DS60-425BL1_2.jpg\"]'),
(838, 'Products/B-Tech Neomounts Laptop Desk Mount (Black) DS20-425BL1.jpg', 'B-Tech Neomounts Laptop Desk Mount (Black) DS20-425BL1', 127.00, 'B-Tech Neomounts laptop desk mount features:\\n\\n\\t- Universal full motion desk mount for laptops up to 17.3 inch with a maximum \r\\n    weight capacity of 11lbs (5 kg).\\n\\t- Versatile tilt (120°), rotate (360°) and swivel (180°) technology \r\\n    allows for the optimal height and viewing angle.\\n\\t- Manual height and depth adjustment to create the perfect working position.\\n\\t- Only minimal depth is required when placed near a wall or separation panel \r\\n    due to the short T-Rex® upper arm.\\n\\t- Smart internal cable management system ensures orderly routing of the cables.\\n\\t- Easy-release VESA system for easy installation.\\n\\t- Includes both desk clamp and grommet.\\n\\t-  VESA pattern: 75x75, 100x100 mm\\n\\t- Min. screen size*: 11.6 inch\\n\\t- Max. screen size*: 17.3 inch\\n\\t-  Height adjustment: 9.65-15.28 inch (24.5-38.8 cm)\\n\\t- Width adjustment: 16.26 inch (41.3 cm)\\n\\t- Depth adjustment: 6.38-19.45 inch (16.2-49.4 cm)\\n\\t- Max. weight: 11lbs (5 kg)\\n*Please note: The inch sizes stated are just an indication, combined with the \r\\n  weight and VESA sizes. The maximum weight and VESA size are absolute restrictions \r\\n  for the products and should not be exceeded. \\n\\n', 'Stands & Mounts', '[\"Products/B-Tech Neomounts Laptop Desk Mount (Black) DS20-425BL1_0.jpg\",\"Products/B-Tech Neomounts Laptop Desk Mount (Black) DS20-425BL1_1.jpg\",\"Products/B-Tech Neomounts Laptop Desk Mount (Black) DS20-425BL1_2.jpg\"]'),
