(1345, 'Products/FREDDE Gaming desk, black, 140-185x74x146 cm.jpg', 'FREDDE Gaming desk, black, 140-185x74x146 cm', 199.00, 'How do you make the perfect gaming station? That\'s what we set out to do with FREDDE desk by researching competitive gaming and enlisting a gamer designer of our own.', 'Desks', '[\"Products/FREDDE Gaming desk, black, 140-185x74x146 cm_0.jpg\",\"Products/FREDDE Gaming desk, black, 140-185x74x146 cm_1.jpg\",\"Products/FREDDE Gaming desk, black, 140-185x74x146 cm_2.jpg\"]'),
(1346, 'Products/UTESPELARE Gaming desk, black, 160x80 cm.jpg', 'UTESPELARE Gaming desk, black, 160x80 cm', 129.00, 'Raise the large, sturdy UTESPELARE gaming desk to a height that optimally suits you. The metal mesh at the back of the table top allows air to circulate and cool your PC when the match heats up.', 'Desks', '[\"Products/UTESPELARE Gaming desk, black, 160x80 cm_0.jpg\",\"Products/UTESPELARE Gaming desk, black, 160x80 cm_1.jpg\",\"Products/UTESPELARE Gaming desk, black, 160x80 cm_2.jpg\"]'),
(1347, 'Products/UTVISNING Gaming desk with shelf, black, 120x60 cm.jpg', 'UTVISNING Gaming desk with shelf, black, 120x60 cm', 90.00, 'This gaming desk is perfect for creating a compact space for playing. Height adjustment, cable management, a shelf for monitors and a computer tower solution – all designed so you can focus on the match.', 'Desks', '[\"Products/UTVISNING Gaming desk with shelf, black, 120x60 cm_0.jpg\",\"Products/UTVISNING Gaming desk with shelf, black, 120x60 cm_1.jpg\",\"Products/UTVISNING Gaming desk with shelf, black, 120x60 cm_2.jpg\"]'),
(1348, 'Products/UTMANING Gaming desk, black, 160x80 cm.jpg', 'UTMANING Gaming desk, black, 160x80 cm', 165.00, 'Functional design, smart details and the possibility to set the height during assembly. This desk helps you find your most comfortable gaming position. Quality tested for many years of use.', 'Desks', '[\"Products/UTMANING Gaming desk, black, 160x80 cm_0.jpg\",\"Products/UTMANING Gaming desk, black, 160x80 cm_1.jpg\",\"Products/UTMANING Gaming desk, black, 160x80 cm_2.jpg\"]'),
(1349, 'Products/UTMANING Gaming desk sit-stand, electric-black, 160x80 cm.jpg', 'UTMANING Gaming desk sit-stand, electric-black, 160x80 cm', 405.00, 'The electric UTMANING gaming desk helps you play better and longer since you can choose your most ergonomic position. Quality tested for years of ups and downs, not just in the game.', 'Desks', '[\"Products/UTMANING Gaming desk sit-stand, electric-black, 160x80 cm_0.jpg\",\"Products/UTMANING Gaming desk sit-stand, electric-black, 160x80 cm_1.jpg\",\"Products/UTMANING Gaming desk sit-stand, electric-black, 160x80 cm_2.jpg\"]'),
(1350, 'Products/HUVUDSPELARE Gaming desk, black, 140x80 cm.jpg', 'HUVUDSPELARE Gaming desk, black, 140x80 cm', 115.00, 'This gaming table has all those key features that help you play at the top of your game: stability, cable management and a hook for your headphones. A good choice for those who want to focus on the match.', 'Desks', '[\"Products/HUVUDSPELARE Gaming desk, black, 140x80 cm_0.jpg\",\"Products/HUVUDSPELARE Gaming desk, black, 140x80 cm_1.jpg\",\"Products/HUVUDSPELARE Gaming desk, black, 140x80 cm_2.jpg\"]'),
(1351, 'Products/BRÄNNBOLL Gaming station, light grey-white, 100x72x180 cm.jpg', 'BRÄNNBOLL Gaming station, light grey-white, 100x72x180 cm', 250.00, 'Always ready. This flexible gaming station holds all your gear, so you can quickly get started. And when you\'re done playing, you can hide everything behind the doors – even your gaming chair.', 'Desks', '[\"Products/BRu00c4NNBOLL Gaming station, light grey-white, 100x72x180 cm_0.jpg\",\"Products/BRu00c4NNBOLL Gaming station, light grey-white, 100x72x180 cm_1.jpg\",\"Products/BRu00c4NNBOLL Gaming station, light grey-white, 100x72x180 cm_2.jpg\"]'),
(1352, 'Products/UPPSPEL Underframe sit-stand f table tp, el, black, 180-140x80 cm.jpg', 'UPPSPEL Underframe sit-stand f table tp, el, black, 180-140x80 cm', 360.00, 'The height of the electric underframe can be adjusted from 72 to 120 cm, so you can always sit or stand at a comfortable height.', 'Desks', '[\"Products/UPPSPEL Underframe sit-stand f table tp, el, black, 180-140x80 cm_0.jpg\",\"Products/UPPSPEL Underframe sit-stand f table tp, el, black, 180-140x80 cm_1.jpg\",\"Products/UPPSPEL Underframe sit-stand f table tp, el, black, 180-140x80 cm_2.jpg\"]'),
(1353, 'Products/UPPSPEL Gaming desk, black, 180x80 cm.jpg', 'UPPSPEL Gaming desk, black, 180x80 cm', 449.00, 'UPPSPEL gaming desk helps you perform at your best. It’s large, durable and sturdy. You can also quickly and easily adjust the height so that you always enjoy the optimal position during the match.', 'Desks', '[\"Products/UPPSPEL Gaming desk, black, 180x80 cm_0.jpg\",\"Products/UPPSPEL Gaming desk, black, 180x80 cm_1.jpg\",\"Products/UPPSPEL Gaming desk, black, 180x80 cm_2.jpg\"]'),
(1354, 'Products/UPPSPEL Gaming desk, black, 140x80 cm.jpg', 'UPPSPEL Gaming desk, black, 140x80 cm', 435.00, 'UPPSPEL gaming desk helps you perform at your best. It’s large, durable and sturdy. You can also quickly and easily adjust the height so that you always enjoy the optimal position during the match.', 'Desks', '[\"Products/UPPSPEL Gaming desk, black, 140x80 cm_0.jpg\",\"Products/UPPSPEL Gaming desk, black, 140x80 cm_1.jpg\",\"Products/UPPSPEL Gaming desk, black, 140x80 cm_2.jpg\"]'),
(1355, 'Products/UPPSPEL Table top, black, 180 cm.jpg', 'UPPSPEL Table top, black, 180 cm', 89.00, 'You can position the table top in two different ways. If you have the contour shape facing forwards, you enjoy relief for forearms and wrists – and having it at the back creates a gap where you can lead all the cables down.', 'Desks', '[\"Products/UPPSPEL Table top, black, 180 cm_0.jpg\",\"Products/UPPSPEL Table top, black, 180 cm_1.jpg\",\"Products/UPPSPEL Table top, black, 180 cm_2.jpg\"]'),
(1356, 'Products/UPPSPEL Table top, black, 140 cm.jpg', 'UPPSPEL Table top, black, 140 cm', 75.00, 'You can position the table top in two different ways. If you have the contour shape facing forwards, you enjoy relief for forearms and wrists – and having it at the back creates a gap where you can lead all the cables down.', 'Desks', '[\"Products/UPPSPEL Table top, black, 140 cm_0.jpg\",\"Products/UPPSPEL Table top, black, 140 cm_1.jpg\",\"Products/UPPSPEL Table top, black, 140 cm_2.jpg\"]'),
(1357, 'Products/STYRSPEL Gaming chair, dark gray-gray.jpg', 'STYRSPEL Gaming chair, dark gray-gray', 369.99, 'STYRSPEL gaming chair helps you play at the top of your game. Adjust the headrest, lumbar support, armrests and the seat height and depth – the mesh material keeps you cool when the game heats up!', 'Chairs', '[\"Products/STYRSPEL Gaming chair, dark gray-gray_0.jpg\",\"Products/STYRSPEL Gaming chair, dark gray-gray_1.jpg\",\"Products/STYRSPEL Gaming chair, dark gray-gray_2.jpg\"]'),
(1358, 'Products/UTESPELARE Gaming chair, Bomstad black.jpg', 'UTESPELARE Gaming chair, Bomstad black', 139.99, 'UTESPELARE gaming chair gives your body a nice support with a synchronized seat and back tilt that precisely follows your movements during the entire match. And after playing, you can sit back to recharge.', 'Chairs', '[\"Products/UTESPELARE Gaming chair, Bomstad black_0.jpg\",\"Products/UTESPELARE Gaming chair, Bomstad black_1.jpg\",\"Products/UTESPELARE Gaming chair, Bomstad black_2.jpg\"]'),
(1359, 'Products/GRUPPSPEL Gaming chair, Gunnared beige.jpg', 'GRUPPSPEL Gaming chair, Gunnared beige', 399.99, 'Cool gaming chair that blends in nicely with other decor. Equipped with many smart functions that allow you to adjust the back, seat, recline angle, tilt, armrests and headrest to sit really comfy.', 'Chairs', '[\"Products/GRUPPSPEL Gaming chair, Gunnared beige_0.jpg\",\"Products/GRUPPSPEL Gaming chair, Gunnared beige_1.jpg\",\"Products/GRUPPSPEL Gaming chair, Gunnared beige_2.jpg\"]'),
(1360, 'Products/MATCHSPEL Gaming chair, Bomstad light gray.jpg', 'MATCHSPEL Gaming chair, Bomstad light gray', 299.99, 'MATCHSPEL gaming chair helps you play at the top of your game. Your whole body enjoys nice support and you can adjust the height of the chair, neck and armrests to sit really comfy when the game begins.', 'Chairs', '[\"Products/MATCHSPEL Gaming chair, Bomstad light gray_0.jpg\",\"Products/MATCHSPEL Gaming chair, Bomstad light gray_1.jpg\",\"Products/MATCHSPEL Gaming chair, Bomstad light gray_2.jpg\"]'),
(1361, 'Products/HUVUDSPELARE Gaming chair, black.jpg', 'HUVUDSPELARE Gaming chair, black', 89.99, 'Adjust the height and angle to sit really comfortably, and let the game begin. The backrest gives you good lumbar support – and even when the game heats up, you stay cool thanks to the mesh net.', 'Chairs', '[\"Products/HUVUDSPELARE Gaming chair, black_0.jpg\",\"Products/HUVUDSPELARE Gaming chair, black_1.jpg\",\"Products/HUVUDSPELARE Gaming chair, black_2.jpg\"]'),
(1362, 'Products/LÖPARBANA Gaming chair, Vissle dark gray.jpg', 'LÖPARBANA Gaming chair, Vissle dark gray', 169.99, 'LÖPARBANA gaming chair helps you play at the top of your game. Adjust the headrest and seat height to enjoy a comfortable support that allows you to focus when the match begins.', 'Chairs', '[\"Products/Lu00d6PARBANA Gaming chair, Vissle dark gray_0.jpg\",\"Products/Lu00d6PARBANA Gaming chair, Vissle dark gray_1.jpg\",\"Products/Lu00d6PARBANA Gaming chair, Vissle dark gray_2.jpg\"]'),
(1363, 'Products/BRÄNNBOLL Gaming lounge chair, Knisa bright blue.jpg', 'BRÄNNBOLL Gaming lounge chair, Knisa bright blue', 249.99, 'Armchair or lounge chair? The choice is yours since the seat cushion is easy to fold out and in. No matter what you prefer, you sit really comfortably while gaming or relaxing.', 'Chairs', '[\"Products/BRu00c4NNBOLL Gaming lounge chair, Knisa bright blue_0.jpg\",\"Products/BRu00c4NNBOLL Gaming lounge chair, Knisa bright blue_1.jpg\",\"Products/BRu00c4NNBOLL Gaming lounge chair, Knisa bright blue_2.jpg\"]'),
(1364, 'Products/BRÄNNBOLL Gaming easy chair, gray-bright yellow.jpg', 'BRÄNNBOLL Gaming easy chair, gray-bright yellow', 149.99, 'A simple, yet elegant easy chair that follows your movements and makes you feel like you’re part of the game. You can tilt forward and back, swing from side to side and rock back and forth.', 'Chairs', '[\"Products/BRu00c4NNBOLL Gaming easy chair, gray-bright yellow_0.jpg\",\"Products/BRu00c4NNBOLL Gaming easy chair, gray-bright yellow_1.jpg\",\"Products/BRu00c4NNBOLL Gaming easy chair, gray-bright yellow_2.jpg\"]'),
