(1381, 'Products/MITTLED LED kitchen cntrtp lighting strip, dimmable white, 15 inch.jpg', 'MITTLED LED kitchen cntrtp lighting strip, dimmable white, 15 inch', 20.00, 'The lighting enhances both function and atmosphere in your kitchen and makes working in the kitchen less of a chore. Easy to install – no electrician needed.', 'LED Lighting', '[\"Products/MITTLED LED kitchen cntrtp lighting strip, dimmable white, 15 inch_0.jpg\",\"Products/MITTLED LED kitchen cntrtp lighting strip, dimmable white, 15 inch_1.jpg\",\"Products/MITTLED LED kitchen cntrtp lighting strip, dimmable white, 15 inch_2.jpg\"]'),
(1382, 'Products/VATTENSTEN LED light strip, white, 39 inch.jpg', 'VATTENSTEN LED light strip, white, 39 inch', 7.99, 'With this LED lighting strip, you can unleash your creativity and decorate with light in all kinds of places in your home – above cabinets, by the TV or under the sofa. The possibilities are endless!', 'LED Lighting', '[\"Products/VATTENSTEN LED light strip, white, 39 inch_0.jpg\",\"Products/VATTENSTEN LED light strip, white, 39 inch_1.jpg\",\"Products/VATTENSTEN LED light strip, white, 39 inch_2.jpg\"]'),
(1383, 'Products/MITTLED LED spotlight, dimmable white.jpg', 'MITTLED LED spotlight, dimmable white', 15.00, 'Show off your beloved dinnerware collection. The lighting enhances the atmosphere and gives a good overview of things inside your cabinets. Easy to install on your own – no electrician needed.', 'LED Lighting', '[\"Products/MITTLED LED spotlight, dimmable white_0.jpg\",\"Products/MITTLED LED spotlight, dimmable white_1.jpg\",\"Products/MITTLED LED spotlight, dimmable white_2.jpg\"]'),
(1384, 'Products/ÖVERSIDAN LED wardrobe lighting strp w sensor, dimmable white, 38 inch.jpg', 'ÖVERSIDAN LED wardrobe lighting strp w sensor, dimmable white, 38 inch', 28.00, 'Dark in the wardrobe? Something easily solved with this modern LED light strip with a built-in sensor that is customized for PAX wardrobes.', 'LED Lighting', '[\"Products/u00d6VERSIDAN LED wardrobe lighting strp w sensor, dimmable white, 38 inch_0.jpg\",\"Products/u00d6VERSIDAN LED wardrobe lighting strp w sensor, dimmable white, 38 inch_1.jpg\",\"Products/u00d6VERSIDAN LED wardrobe lighting strp w sensor, dimmable white, 38 inch_2.jpg\"]'),
(1385, 'Products/KAPPLAKE LED spotlight, white.jpg', 'KAPPLAKE LED spotlight, white', 3.49, 'It\'s easy to mount KAPPLAKE spotlight with the included sticky gel-pad anywhere you like. The gel pad is easy to roll-off by hand, wash with water and reattach to the lamp.', 'LED Lighting', '[\"Products/KAPPLAKE LED spotlight, white_0.jpg\",\"Products/KAPPLAKE LED spotlight, white_1.jpg\",\"Products/KAPPLAKE LED spotlight, white_2.jpg\"]');
